import React, { useMemo, useState } from "react";
import "../styles/DataPage.css";

const VRU_OPTIONS = [
  { key: "ped_arm", label: "Pedestrian with Arm Swing" },
  { key: "ped_no_arm", label: "Pedestrian Without Arm Swing" },
  { key: "bike_pedal", label: "Bicyclist With Pedaling" },
  { key: "bike_no_pedal", label: "Bicyclist Without Pedaling" },
  { key: "escooter", label: "E-Scooter" },
  { key: "wheelchair", label: "Wheelchair" },
  { key: "bird_escooter", label: "Bird E-Scooter" },
  { key: "lime_escooter", label: "Lime E-Scooter" },
];

const INIT_VRU_PREFS = VRU_OPTIONS.reduce((acc, o) => {
  acc[o.key] = "ignore"; // "ignore" | "must" | "mustNot"
  return acc;
}, {});

const DEFAULTS = {
  radarMotion: "Stationary",
  environment: "Controlled",
  numVRUs: "",
  pathType: "Straight", // Straight | Curved
  slope: "0",
  turn: "Right Turn by 90 Degrees",
  gait: "Paced Walking",
  minInterval: "0.00",
  minTrajLen: "0.00",
  // Right-side ranges (no enforced limits; integers as requested)
  ranges: {
    vruRange: { min: "0", max: "50" },
    azimuth: { min: "-45", max: "40" },
    velocity: { min: "0", max: "8" },
    rcs: { min: "-25", max: "-5" },
    snr: { min: "5", max: "30" },
  },
};

export default function DataPage() {
  const [radarMotion, setRadarMotion] = useState(DEFAULTS.radarMotion);
  const [environment, setEnvironment] = useState(DEFAULTS.environment);
  const [numVRUs, setNumVRUs] = useState(DEFAULTS.numVRUs);
  const [pathType, setPathType] = useState(DEFAULTS.pathType);
  const [slope, setSlope] = useState(DEFAULTS.slope);
  const [turn, setTurn] = useState(DEFAULTS.turn);
  const [vruPrefs, setVruPrefs] = useState({ ...INIT_VRU_PREFS });
  const [gait, setGait] = useState(DEFAULTS.gait);
  const [minInterval, setMinInterval] = useState(DEFAULTS.minInterval);
  const [minTrajLen, setMinTrajLen] = useState(DEFAULTS.minTrajLen);

  const [ranges, setRanges] = useState({ ...DEFAULTS.ranges });

  const showControlledOnly = environment === "Controlled";
  const showStraightOnly = showControlledOnly && pathType === "Straight";
  const showCurvedOnly = showControlledOnly && pathType === "Curved";

  // Show gait picker if either pedestrian type is explicitly required
  const showGait = useMemo(() => {
    return (
      vruPrefs["ped_arm"] === "must" || vruPrefs["ped_no_arm"] === "must"
    );
  }, [vruPrefs]);

  function setVruPref(key, next) {
    setVruPrefs((prev) => {
      const current = prev[key];
      // clicking the same choice again toggles back to "ignore"
      const value = current === next ? "ignore" : next;
      return { ...prev, [key]: value };
    });
  }

  function resetAll() {
    setRadarMotion(DEFAULTS.radarMotion);
    setEnvironment(DEFAULTS.environment);
    setNumVRUs(DEFAULTS.numVRUs);
    setPathType(DEFAULTS.pathType);
    setSlope(DEFAULTS.slope);
    setTurn(DEFAULTS.turn);
    setVruPrefs({ ...INIT_VRU_PREFS });
    setGait(DEFAULTS.gait);
    setMinInterval(DEFAULTS.minInterval);
    setMinTrajLen(DEFAULTS.minTrajLen);
    setRanges({ ...DEFAULTS.ranges });
  }

  function applyFilters(e) {
    e?.preventDefault?.();
    const payload = {
      radarMotion,
      environment,
      numVRUs: numVRUs ? parseInt(numVRUs, 10) : null,
      pathType: showControlledOnly ? pathType : null,
      slope: showStraightOnly ? parseInt(slope, 10) : null,
      turn: showCurvedOnly ? turn : null,
      vruPreferences: vruPrefs, // {key: "ignore" | "must" | "mustNot"}
      gait: showGait ? gait : null,
      minInterval: parseFloat(minInterval),
      minTrajectoryLength: showControlledOnly ? parseFloat(minTrajLen) : null,
      ranges: {
        vruRange: {
          min: ranges.vruRange.min,
          max: ranges.vruRange.max,
        },
        azimuth: {
          min: ranges.azimuth.min,
          max: ranges.azimuth.max,
        },
        velocity: {
          min: ranges.velocity.min,
          max: ranges.velocity.max,
        },
        rcs: {
          min: ranges.rcs.min,
          max: ranges.rcs.max,
        },
        snr: {
          min: ranges.snr.min,
          max: ranges.snr.max,
        },
      },
    };
    // Integration point: send payload to your backend/filter service
    console.log("Apply Filters ->", payload);
    // You can surface a toast/snackbar here if you use a UI lib.
  }

  return (
    <div className="data-page">
      <main className="container">
        <div className="page-title">
          <h1>VRU Radar Micro-Doppler Database Tool</h1>
          <div className="actions">
            <button type="button" className="btn ghost" onClick={resetAll}>
              Reset
            </button>
            <button type="button" className="btn primary" onClick={applyFilters}>
              Apply
            </button>
          </div>
        </div>

        <section className="grid">
          {/* LEFT: Scenario Filters */}
          <form className="card left" onSubmit={applyFilters}>
            <h2>Filters</h2>
            <p className="hint">
              Refine the dataset using the following parameters.
            </p>

            {/* 1. Radar Motion Type */}
            <div className="field">
              <label>1. Radar Motion Type</label>
              <select
                value={radarMotion}
                onChange={(e) => setRadarMotion(e.target.value)}
              >
                <option>Stationary</option>
                <option>Moving</option>
              </select>
            </div>

            {/* 2. Data Collection Environment */}
            <div className="field">
              <label>2. Data Collection Environment</label>
              <select
                value={environment}
                onChange={(e) => setEnvironment(e.target.value)}
              >
                <option>Controlled</option>
                <option>Naturalistic</option>
              </select>
            </div>

            {/* 3. Number of VRUs */}
            <div className="field">
              <label>3. Number of VRUs</label>
              <input
                type="number"
                inputMode="numeric"
                min="1"
                step="1"
                placeholder="Enter integer > 0"
                value={numVRUs}
                onChange={(e) => setNumVRUs(e.target.value)}
              />
            </div>

            {/* 4. Trajectory Path Type (Controlled only) */}
            {showControlledOnly && (
              <div className="field">
                <label>4. Trajectory Path Type (Only if Controlled)</label>
                <select
                  value={pathType}
                  onChange={(e) => setPathType(e.target.value)}
                >
                  <option value="Straight">Straight</option>
                  <option value="Curved">Curved</option>
                </select>
              </div>
            )}

            {/* 5. Slope (Straight only) */}
            {showStraightOnly && (
              <div className="field">
                <label>5. Trajectory Path Slope (Straight path only)</label>
                <select value={slope} onChange={(e) => setSlope(e.target.value)}>
                  {["-45", "0", "45", "90", "135", "180", "225", "270"].map(
                    (deg) => (
                      <option key={deg} value={deg}>
                        {deg}
                      </option>
                    )
                  )}
                </select>
              </div>
            )}

            {/* 6. Turn Options (Curved only) */}
            {showCurvedOnly && (
              <div className="field">
                <label>6. Trajectory Turn Options (Curved path only)</label>
                <select value={turn} onChange={(e) => setTurn(e.target.value)}>
                  <option>Right Turn by 90 Degrees</option>
                  <option>Right Turn by 45 Degrees</option>
                </select>
              </div>
            )}

            {/* 7. VRU Types with tri-state include/exclude */}
            <div className="field">
              <label>7. VRU Types</label>
              <p className="admin-note">
                Admin: Not a dropdown. For each VRU, set <b>Must contain</b> or{" "}
                <b>Must not contain</b>. Leave both off for “No preference”.
              </p>

              <div className="vru-grid">
                {VRU_OPTIONS.map((o) => {
                  const value = vruPrefs[o.key];
                  const isMust = value === "must";
                  const isMustNot = value === "mustNot";
                  return (
                    <div key={o.key} className="vru-card">
                      <div className="vru-title">{o.label}</div>
                      <div className="vru-controls">
                        <label className={`toggle ${isMust ? "on" : ""}`}>
                          <input
                            type="checkbox"
                            checked={isMust}
                            onChange={() => setVruPref(o.key, "must")}
                          />
                          Must contain
                        </label>
                        <label className={`toggle ${isMustNot ? "on" : ""}`}>
                          <input
                            type="checkbox"
                            checked={isMustNot}
                            onChange={() => setVruPref(o.key, "mustNot")}
                          />
                          Must not contain
                        </label>
                      </div>
                      {value === "ignore" && (
                        <div className="vru-subtle">No preference</div>
                      )}
                    </div>
                  );
                })}
              </div>
            </div>

            {/* 8. Pedestrian Gait Type (only if pedestrian is must) */}
            {showGait && (
              <div className="field">
                <label>8. Pedestrian Gait Type (Pedestrian selected)</label>
                <select value={gait} onChange={(e) => setGait(e.target.value)}>
                  <option>Paced Walking</option>
                  <option>Natural Walking</option>
                  <option>Jogging</option>
                  <option>Irregular Walking</option>
                </select>
              </div>
            )}

            {/* 9. Minimum Time Interval(s) */}
            <div className="field">
              <label>9. Minimum Time Interval (s)</label>
              <input
                type="number"
                step="0.01"
                value={minInterval}
                onChange={(e) => setMinInterval(e.target.value)}
              />
            </div>

            {/* 10. Minimum Trajectory Length (Controlled only) */}
            {showControlledOnly && (
              <div className="field">
                <label>10. Minimum Trajectory Length (m)</label>
                <input
                  type="number"
                  step="0.01"
                  value={minTrajLen}
                  onChange={(e) => setMinTrajLen(e.target.value)}
                />
              </div>
            )}
          </form>

          {/* RIGHT: VRU Data Filters (ranges) */}
          <aside className="card right">
            <h2>VRU Data Filters</h2>
            <p className="admin-note">
              Admin: These may move to a separate page. All entries accept{" "}
              <b>integers</b>. No min/max enforcement.
            </p>

            <RangePair
              title="1. VRU Range (m)"
              value={ranges.vruRange}
              onChange={(min, max) =>
                setRanges((r) => ({ ...r, vruRange: { min, max } }))
              }
            />

            <RangePair
              title="2. VRU Azimuth Angle (Deg)"
              value={ranges.azimuth}
              onChange={(min, max) =>
                setRanges((r) => ({ ...r, azimuth: { min, max } }))
              }
            />

            <RangePair
              title="3. VRU Constituent Point Velocity (m/s)"
              value={ranges.velocity}
              onChange={(min, max) =>
                setRanges((r) => ({ ...r, velocity: { min, max } }))
              }
            />

            <RangePair
              title="4. VRU Constituent Point RCS (dBscm)"
              value={ranges.rcs}
              onChange={(min, max) =>
                setRanges((r) => ({ ...r, rcs: { min, max } }))
              }
            />

            <RangePair
              title="5. VRU Constituent Point SNR (dB)"
              value={ranges.snr}
              onChange={(min, max) =>
                setRanges((r) => ({ ...r, snr: { min, max } }))
              }
            />
          </aside>
        </section>
      </main>
    </div>
  );
}

function RangePair({ title, value, onChange }) {
  return (
    <div className="field range-pair">
      <label>{title}</label>
      <div className="range-row">
        <div className="range-box">
          <div className="mini-label">min</div>
          <input
            type="number"
            step="1"
            value={value.min}
            onChange={(e) => onChange(e.target.value, value.max)}
          />
        </div>
        <div className="range-box">
          <div className="mini-label">max</div>
          <input
            type="number"
            step="1"
            value={value.max}
            onChange={(e) => onChange(value.min, e.target.value)}
          />
        </div>
      </div>
    </div>
  );
}
